import './App.css';
import './Project.jsx';
import Navbar from 'react-bootstrap/Navbar'
import Container from 'react-bootstrap/Container'
import portrait from './img/me.png';

import 'bootstrap/dist/css/bootstrap.min.css';

const headerStyle = {
  color: '#282c34',
  fontSize: '50px',
  letterSpacing: '5px',
  marginLeft: '25vw'  
};

const subheaderStyle = {
  color: 'white'
};


const App = () => {
  return (
    <div className="App">
      <header className="App-header">
      <Container>
        <Navbar className="justify-content-center" expand="lg" variant="light" /*bg="light"*/ fixed="top">
          <Navbar.Brand href="#">About Me</Navbar.Brand>
          <Navbar.Brand href="#">Projects</Navbar.Brand>
          <Navbar.Brand href="#">Experience</Navbar.Brand>
        </Navbar>
      </Container>
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <div className="nameCard">
          <h1 style={headerStyle}>
              Josephine Lo
          </h1>
          <img src={portrait} className="portrait" alt="Portrait of Josephine Lo" />
        </div>
        <h2 style={subheaderStyle}>
          About Me
        </h2>

        <h2 style={subheaderStyle}>
          Projects
        </h2>

        <h2 style={subheaderStyle}>
          Experience
        </h2>




        {/* <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a> */}
      </header>
    </div>
  );
}

export default App;
